import { Link } from "react-router-dom";




class About extends Component {
   
  render(){
    return (
        <div>
            <Link to="/">Home</Link>
            <h1>About</h1>
            <h1>this</h1>
            <h1>Shit</h1>
        </div>
    )
  }
}

export default About;
